(function(){
  'use strict';
    function Bingo(num){
        this.init(num);
    }
    Bingo.prototype = {
        init: function(num){
            // create bingo array
            //this.bingoArray = Array.from(Array(num+1).keys()).slice(1);
            this.bingoArray = [];
            for( var i=1; i<=num;i++ ){
                this.bingoArray.push(i);
            }

            // initialize value
            this.timer = null;
            this.isPlaying = false;

            // selected bingonumber
            this.bingoNum  = 0;

            // get elements
            this.leftPanel = document.getElementById("left-panel");
            this.rightPanel = document.getElementById("right-panel");
            this.stopButton = document.getElementById("stop-btn");
            this.spinButton = document.getElementById("spinButton");

            // sound manager
            this.soundManager = this.getSoundObject();

            // do event
            this.renderBingo();
            this.bindEvent();
        },
        renderBingo: function(){
            var _self = this;
            var fragment = document.createDocumentFragment();
            var divWrapper;
            this.bingoArray.forEach(function(elem, index){
                if( index % 15 === 0 ){
                    divWrapper = fragment.appendChild(document.createElement("div"));
                }
                var numDiv = divWrapper.appendChild(document.createElement("div"));
                numDiv.className = "bingo";
                numDiv.textContent = _self.showNumber(elem);
            });
            document.getElementById("result").appendChild(fragment);
        },
        bindEvent: function(){
            var _self = this;
            this.spinButton.addEventListener("click", function(){ _self.clickSpin(); }, false );
            this.stopButton.addEventListener("click", function(){ _self.stopSlot(); }, false );
        },
        clickSpin: function(){
            var _self = this;
            if (this.isPlaying || this.bingoArray.length === 0){
                return;
            }
            this.soundManager.playDrum();

            this.isPlaying = true;
            this.spinButton.className = "inactive";
            this.stopButton.className = "btn";

            this.timer = setInterval( function(){ _self.showRandom(); } , 25 );
        },
        showRandom: function(){
            this.bingoNum = Math.floor(Math.random() * this.bingoArray.length);
            var showText = this.showNumber(this.bingoArray[this.bingoNum]);
            this.leftPanel.textContent = showText.substr(0,1);
            this.rightPanel.textContent = showText.substr(1,2);
        },
        showNumber: function(number){
            return (number < 10 ? "0" : "") + number;
        },
        stopSlot: function(){
            if (!this.isPlaying){
                return;
            }
            // clear timer
            clearInterval(this.timer);

            this.soundManager.stopDrum();
            this.soundManager.playCymbal();

            // init
            this.isPlaying = false;
            this.timer = null;
            this.spinButton.className = "";
            this.stopButton.className = "btn inactive";

            // change color
            var bingoDiv = document.querySelectorAll(".bingo");
            bingoDiv[this.bingoArray[this.bingoNum]-1].className += " unmatched";

            // delete selected number
            this.bingoArray.splice(this.bingoNum,1);
        },
        getSoundObject: function(){
            var DRUM_DATA = "data:audio/mp3;base64,";
            var CYMBAL_DATA = "data:audio/mp3;base64,";

            var drum = null;
            var cymbal = null;

            var data2buffer = function(data) {
                var byteString = atob(data.split(',')[1]);
                var len = byteString.length;
                var buffer = new Uint8Array(len);
                for (var i=0; i<len; ++i) {
                    buffer[i] = byteString.charCodeAt(i);
                }
                return buffer.buffer;
            };

            var drumBuffer = null;
            var context = new (window.AudioContext || window.webkitAudioContext)();
            context.decodeAudioData(data2buffer(DRUM_DATA)).then(function(buffer) {
                drumBuffer = buffer;
            });

            var cymbalBuffer = null;
            var context2 = new (window.AudioContext || window.webkitAudioContext)();
            context2.decodeAudioData(data2buffer(CYMBAL_DATA)).then(function(buffer2){
                cymbalBuffer = buffer2;
            });

            return {
                playDrum    : playDrum,
                stopDrum    : stopDrum,
                playCymbal  : playCymbal
            };


            function playDrum(){
                if(!drumBuffer){
                    return;
                }
                drum = context.createBufferSource();
                drum.buffer = drumBuffer;
                drum.connect(context.destination);
                drum.start(0);
            }

            function stopDrum(){
                if(!drumBuffer){
                    return;
                }
                drum.stop();
            }

            function playCymbal(){
                if(!cymbalBuffer){
                    return;
                }
                cymbal = context2.createBufferSource();
                cymbal.buffer = cymbalBuffer;
                cymbal.connect(context2.destination);
                cymbal.start(0);
            }
        }
    }

    // start 75
    new Bingo(75);

})();
